import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Button from 'react-bootstrap/esm/Button';
import {useRef} from 'react';

const Header = () => {

     const handleClickAbout = event =>{
          console.log(event.currentTarget.id);
     };

    return ( 
     <Navbar sticky="top" className="navbar mt-5">
          <Container display="fluid">
               <Navbar.Brand href="#home">Ulete</Navbar.Brand>
               <Nav className="ml-auto">
                    <Nav.Link className="me-5 text-center fw-bold nav-item" href="#home">Home</Nav.Link>
                    <Nav.Link className="me-5 text-cente fw-bold nav-item" href="#">About</Nav.Link>
                    <button id="login" className="btn btn-primary me-5 text-center fw-bold" type="button">Login</button>
                    <button className="btn btn-secondary me-5 text-center fw-bold" type="button">SignUp</button>
               </Nav>

          </Container>
     </Navbar>
     );
}

export default Header;
